import React from 'react';
import './country.css';
class Country extends React.Component{
    constructor(props){
        super(props);
        this.individual=props.country
    }
    render(){
        return(

            <div className="card">
                <img src={this.individual.flag} alt="Country-flag"></img>
                <h4>{this.individual.name}</h4>
        <div><h5>Population</h5>{this.individual.population}</div>
        <div><h5>Region</h5>{this.individual.region}</div>
        <div><h5>Capital</h5>{this.individual.capital}</div>
                </div>
        )
    }
}
export default Country;
